import React from 'react';

export default function Paged ({vgPerPage, allVideogames, paged}){
    const pageNumbers = []

    for(let i = 0; i <= Math.ceil(allVideogames/vgPerPage); i++){
        pageNumbers.push(i+1)
    }
    console.log(pageNumbers)
    console.log(paged)
    return (
        <nav style={{height:"250px", width:"100%"}}>
            <ul>
                {pageNumbers.length && pageNumbers.map(number => (
                    <li key={number}>
                        <a onClick={() => {paged(number)}}>{number}</a>
                    </li>
                ))}
            </ul>
        </nav>
    )
}
